// 2483. Minimum Penalty for a Shop
// https://leetcode.com/problems/minimum-penalty-for-a-shop/

struct Solution;

impl Solution {
    pub fn best_closing_time(customers: String) -> i32 {
        // Initial penalty: closing at hour 0 means all 'Y's are penalties
        let mut penalty = customers.chars().filter(|&c| c == 'Y').count() as i32;
        let mut min_penalty = penalty;
        let mut best_hour = 0;

        // Try closing at each hour from 1 to n
        for (i, ch) in customers.chars().enumerate() {
            // If we extend opening by one hour:
            // - 'Y' means we served a customer: penalty decreases
            // - 'N' means we were open with no customer: penalty increases
            if ch == 'Y' {
                penalty -= 1;
            } else {
                penalty += 1;
            }

            // Check if this is the best closing time so far
            if penalty < min_penalty {
                min_penalty = penalty;
                best_hour = (i + 1) as i32;
            }
        }

        best_hour
    }

    // Time exceed
    pub fn _best_closing_time(customers: String) -> i32 {
        println!("customers: {:?}", &customers);

        let mut penalties = vec![0; customers.len() + 1];
        let mut min = customers.len();

        for (hour, c) in customers.chars().enumerate() {
            for close_hour in 0..penalties.len() {
                match c {
                    'Y' => {
                        if hour >= close_hour {
                            penalties[close_hour] += 1;
                        }
                    }
                    'N' => {
                        if hour < close_hour {
                            penalties[close_hour] += 1;
                        }
                    }
                    _ => {}
                }

                if hour == customers.len() - 1 {
                    min = min.min(penalties[close_hour]);
                }
            }
        }

        println!("penalties: {:?}, min: {min}", &penalties);
        for (i, &c) in penalties.iter().enumerate() {
            if c == min {
                return i as i32;
            }
        }
        penalties.len() as i32 - 1
    }
}

#[cfg(test)]
mod tests {
    use crate::medium::minimum_penalty_for_a_shop::Solution;

    #[test]
    fn test_best_closing_time_1() {
        let customers = "YYNY".to_string();
        assert_eq!(2, Solution::best_closing_time(customers));
    }

    #[test]
    fn test_best_closing_time_2() {
        let customers = "NNNNN".to_string();
        assert_eq!(0, Solution::best_closing_time(customers));
    }

    #[test]
    fn test_best_closing_time_3() {
        let customers = "YYYY".to_string();
        assert_eq!(4, Solution::best_closing_time(customers));
    }

    #[test]
    fn test_best_closing_time_4() {
        let customers = "YNYY".to_string();
        assert_eq!(4, Solution::best_closing_time(customers));
    }

    #[test]
    fn test_best_closing_time_5() {
        let customers = "".to_string();
        assert_eq!(23300, Solution::best_closing_time(customers));
    }
}
